The customer points currently have two main tunable options: _distance_scale default 1.5 _density_scale default 1.0 After running the main process, you can re-run the steps creating the geofaker.customer points using the following code. This example doubles the density scale (from 1.5 to 3) and reduces density from 1.0 to 0.25. See app/run_faker.sql for what runs by default. CALL geofaker.points_around_point(_distance_scale:=3, _density_scale:=0.25); DROP TABLE IF EXISTS geofaker.customer;
CREATE TABLE geofaker.customer AS
SELECT * FROM faker_customer_location ORDER BY store_id, customer_id
;
COMMENT ON TABLE geofaker.customer IS 'Created by Geo Faker, a PgOSM Flex based project.';
